import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import HomePage from "./components/mainpages/homePage.js"
import Bars from "./components/mainpages/bars.js"

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" component={HomePage} />

      </Routes>
    </Router>
  )
}


export default App
